sys_variable_value.value:
(function execute(inputs, outputs) {

	 // 取得するページの順序数 (inputs.first_glacier) の値が
     // 0 または 0 未満、または序数がデータベース内の氷河レコードの数より大きい場合
     // outputs.first_glacier_to_get に文字列値 1を設定します
     //そうでない場合は、inputs.first_glacierの値をfirst_glacier_to_getに設定します。
    if (parseInt(inputs.first_glacier) <= 0 || 
parseInt(inputs.first_glacier) > 132890) { 
        outputs.first_glacier_to_get = "1"; 
    } else { 
        outputs.first_glacier_to_get = inputs.first_glacier; 
    }

     // World Glaciers Web サービスは、ページが次の場合に 442 エラーを返します。
     // サイズは 1 から 10 までの値ではありません。 受信を回避するには
     //ページ サイズ (inputs.glaciers_per_page) の値を確認してください。
     // 値が許容範囲外の場合は、文字列値1をOutputs.glaciers_per_pageに設定します
     //値が許容範囲内（1 から10まで）の場合は、inputs.glaciers_per_pageを 
     // Outputs.glaciers_per_pageに設定します。
    if (parseInt(inputs.glaciers_per_page) <= 0 || 
parseInt(inputs.glaciers_per_page) > 10) { 
        outputs.glaciers_per_page = "1"; 
    } else { 
        outputs.glaciers_per_page = inputs.glaciers_per_page; 
}

     // 取得するページ数 (inputs.pages_to_get) の値が 0 の場合
     // またはゼロ未満の場合は、文字列値 1 をoutputs.number_of_pagesに設定します。
     // そうでない場合は、inputs.pages_to_get の値をoutputs.number_of_pages に設定します。
    if (parseInt(inputs.pages_to_get) <= 0) { 
        outputs.number_of_pages = "1"; 
    } else { 
        outputs.number_of_pages = inputs.pages_to_get; 
    }
})(inputs, outputs)

